import Link from 'next/link'

const linkStyle ={
    marginRight : 15
};

const Header = () => (
    <div>
        <Link href="/">
            <a style={linkStyle}>home</a>            
        </Link>
        <Link href="/profile">
            <a style={linkStyle}>Profile</a>            
        </Link>
    </div>
);

export default Header;
